.work {
    position: absolute;
    top: 0px;
    left: 0px;
    width: 100%;
    height: 100%;
    background-color: white;
    transition-duration: 0.3s;
    transition-timing-function: ease-in-out;
}

#work-title-field {
    position: relative;
    width: 100%;
    border: none;
    outline: none;
    color: black;
    font-weight: 500;
    margin-top: 120px;
    font-size: 4.5vmin;
    padding-left: 20px;
    font-family: 'Avenir';
}

#work-content-field {
    padding: 20px;
    outline: none;
    color: black;
    font-size: 24px;
    font-weight: 300;
    font-family: 'Avenir';
}

/* Removes the fine-detail-zoom thing on ios. */
.context-menu-holder > * {
    -webkit-touch-callout: none;
    -webkit-user-select: none;
}
